#include <iostream>
#include <string>
#include <vector>

using namespace std;

/**
 * 在一个由 'L' , 'R' 和 'X' 三个字符组成的字符串（例如"RXXLRXRXL"）中进行移动操作。
 * 一次移动操作指用一个"LX"替换一个"XL"，或者用一个"XR"替换一个"RX"。
 * 现给定起始字符串start和结束字符串end，请编写代码，当且仅当存在一系列移动操作使得start可以转换成end时， 返回True。
 * 
 * 来源：力扣（LeetCode）
 * 链接：https://leetcode-cn.com/problems/swap-adjacent-in-lr-string
 * 著作权归领扣网络所有。商业转载请联系官方授权，非商业转载请注明出处。
 * 
 * Solution:
 * RX.. 中R能向右移动
 * ..XL 中L能向左移动
*/

class Solution {
public:
    bool canTransform(string start, string end) {
        // first pass, check LR order
        int i = 0;
        int len = static_cast<int>(start.size());
        int buf[10000] = {0};
        int buf_idx = 0;
        for (; i<len; ++i) {
            if (start[i] != 'X') buf[buf_idx++] = i;
        }
        int sbufx = 0;
        for (i=0; i<len; ++i) {
            if (end[i] != 'X') {
                const char& sc = start[buf[sbufx]];
                if (sc != end[i]) return false;
                if (sc == 'R' && buf[sbufx]>i) return false;
                if (sc == 'L' && buf[sbufx]<i) return false;
                ++sbufx;
            }
        }
        return sbufx == buf_idx;
    }
};

int main(int argc, const char* argv[]) {
    string start = "";
    string end = "";
    auto sol = Solution();
    cout << "ans: " << sol.canTransform(start, end) << endl;
    return 0;
}